import Button from 'react-bootstrap/Button';
import Badge from 'react-bootstrap/Badge';

function AddTask() {
    return (
      <div>
        <input
          type="text"
          placeholder={"Add new task ..."}
        />
        <Button variant="primary">Add</Button>
      </div>
    );
  }
  
  export default AddTask;
